var last_timestamps_text = 'agent_timestamps,pipeline_id=${pipeline:id()} last_timestamp='

for(var i = 0; i < records.length; i++) {
  try {
    if (records[i].value['response']['results'][0]['series'] == null) {
      var newRecord = sdcFunctions.createRecord(records[i].sourceId + ':' + records.length);
      newRecord.value = {'last_timestamp': last_timestamps_text + records[i].value['last_timestamp'] + 'i'}

      try {
        output.write(newRecord);
      } catch (e) {
        error.write(newRecord, e);
      }
      continue;
    } 
    series = records[i].value['response']['results'][0]['series'][0]
    for (var k = 0; k < series['values'].length; k++) {
      var newRecord = sdcFunctions.createRecord(records[i].sourceId + ':' + k);
      newRecord.value = {};
      for (var c = 0; c < series['columns'].length; c++) {
		if (series['values'][k][c] == null) {
          continue;
        }
        newRecord.value[series['columns'][c]] = typeof series['values'][k][c] === 'string' 
          ? series['values'][k][c].replace(/[\. ]+/g, '_') : series['values'][k][c]
      }

      output.write(newRecord);
    }

	var newRecord = sdcFunctions.createRecord(records[i].sourceId + ':' + records.length);
	if (k > 0) {
      newRecord.value = {'last_timestamp': last_timestamps_text + series['values'][k - 1][0] + 'i'}
    } else {
      newRecord.value = {'last_timestamp': last_timestamps_text + records[i].value['last_timestamp'] + 'i'}
    }

    try {
      output.write(newRecord);
    } catch (e) {
      error.write(newRecord, e);
    }
  } catch (e) {
    // Send record to error
    error.write(records[i], e);
  }
}

