      var newRecord = sdcFunctions.createRecord(records[i].sourceId + ':' + i);
      properties['what'] = properties['what'] = state['VALUES_COLUMNS'][j];;
      newRecord.value = {'timestamp' : timestamp,
                         'properties' : properties,
                         'value': state['VALUE_CONSTANT']};
      output.write(newRecord);
    }

    for (var j = 0; j < state['VALUES_COLUMNS'].length; j++) {
      var newRecord = sdcFunctions.createRecord(records[i].sourceId + ':' + i);
      if (state['VALUES_COLUMNS'].length == 0) { 
        properties['what'] = state['MEASUREMENT_NAME'];
      } else {
        properties['measurement_category'] = state['MEASUREMENT_NAME'];
        properties['what'] = state['VALUES_COLUMNS'][j];
      }

      newRecord.value = {'timestamp' : timestamp,
                         'properties' : properties,
                         'value': records[i].value[state['VALUES_COLUMNS'][j]]};
      output.write(newRecord);
    }

    // output.write(records[i]);
  } catch (e) {
    // Send record to error
    error.write(records[i], e);
  }
}

